import { Button, StyleSheet, Text, View, TextInput } from 'react-native';

function AddClient(params) {
    return (
        <View>
            <TextInput
                style={styles.input}
                onChangeText={setClientName}
                name="clientName"
                value={clientName || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setContactName}
                name="contactName"
                value={contactName || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setContactPhone}
                name="contactPhone"
                value={contactPhone || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setContactEmail}
                name="contactEmail"
                value={contactEmail || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setContactLanguage}
                name="contactLanguage"
                value={contactLanguage || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setEndTime}
                name="endTime"
                value={endTime || ""}
            />
            <TextInput
                style={styles.input}
                onChangeText={setBillPeriod}
                name="billPeriod"
                value={billPeriod || ""}
            />
            <Button onPress={()=>params.handlAdd} title="Add Client Info"></Button>
        </View>
    )
}

export default AddClient;
